//
// Arguments    : double b[7]
//                double a[7]
//                const double x[1036]
//                const double zi[6]
//                double y[1036]
// Return Type  : void
//
static void filter(double b[7], double a[7], const double x[1036], const double
                   zi[6], double y[1036])
{
  double a1;
  int k;
  double dbuffer[7];
  int j;
  a1 = a[0];
  if ((!((!rtIsInf(a[0])) && (!rtIsNaN(a[0])))) || (a[0] == 0.0) || (!(a[0] !=
        1.0))) {
  } else {
    for (k = 0; k < 7; k++) {
      b[k] /= a1;
    }

    for (k = 0; k < 6; k++) {
      a[k + 1] /= a1;
    }

    a[0] = 1.0;
  }

  for (k = 0; k < 6; k++) {
    dbuffer[k + 1] = zi[k];
  }

  for (j = 0; j < 1036; j++) {
    for (k = 0; k < 6; k++) {
      dbuffer[k] = dbuffer[k + 1];
    }

    dbuffer[6] = 0.0;
    for (k = 0; k < 7; k++) {
      dbuffer[k] += x[j] * b[k];
    }

    for (k = 0; k < 6; k++) {
      dbuffer[k + 1] -= dbuffer[0] * a[k + 1];
    }

    y[j] = dbuffer[0];
  }
}

//
// Arguments    : double x[1036]
// Return Type  : void
//
static void flipud(double x[1036])
{
  int i;
  double xtmp;
  for (i = 0; i < 518; i++) {
    xtmp = x[i];
    x[i] = x[1035 - i];
    x[1035 - i] = xtmp;
  }
}

//
// Arguments    : const double x[2048]
// Return Type  : double
//
static double mean(const double x[2048])
{
  double y;
  int k;
  y = x[0];
  for (k = 0; k < 2047; k++) {
    y += x[k + 1];
  }

  y /= 2048.0;
  return y;
}

//
// Arguments    : const double a[2048]
//                double y[2048]
// Return Type  : void
//
static void power(const double a[2048], double y[2048])
{
  double x[2048];
  int k;
  int b_k;
  memcpy(&x[0], &a[0], sizeof(double) << 11);

#pragma omp parallel for \
 num_threads(omp_get_max_threads()) \
 private(b_k)

  for (k = 1; k < 2049; k++) {
    b_k = k;
    y[b_k - 1] = x[b_k - 1] * x[b_k - 1];
  }
}

//
// Arguments    : const double a[2048]
//                double b[2048]
// Return Type  : void
//
static void repmat(const double a[2048], double b[2048])
{
  memcpy(&b[0], &a[0], sizeof(double) << 11);
}

//
// [5 40] bandpass butterworth N=3
// Arguments    : const double X[1000]
//                double Y[1000]
// Return Type  : void
//
static void ssvepcfilt2(const double X[1000], double Y[1000])
{
  double d1;
  double d2;
  int i;
  double y[1036];
  double dv6[7];
  double dv7[7];
  double a[6];
  static const double dv8[7] = { 0.0418768282347742, 0.0, -0.125630484704323,
    0.0, 0.125630484704323, 0.0, -0.0418768282347742 };

  static const double dv9[7] = { 1.0, -3.99412602172993, 6.79713743558926,
    -6.44840721730666, 3.65712515526032, -1.17053739881085, 0.159769122451512 };

  double b_y[1036];
  static const double b_a[6] = { -0.041876828234757295, -0.041876828234824783,
    0.083753656469613066, 0.0837536564695041, -0.041876828234757114,
    -0.04187682823477689 };

  double c_y[1036];
  d1 = 2.0 * X[0];
  d2 = 2.0 * X[999];
  for (i = 0; i < 18; i++) {
    y[i] = d1 - X[18 - i];
  }

  memcpy(&y[18], &X[0], 1000U * sizeof(double));
  for (i = 0; i < 18; i++) {
    y[i + 1018] = d2 - X[998 - i];
  }

  for (i = 0; i < 7; i++) {
    dv6[i] = dv8[i];
    dv7[i] = dv9[i];
  }

  for (i = 0; i < 6; i++) {
    a[i] = b_a[i] * y[0];
  }

  memcpy(&b_y[0], &y[0], 1036U * sizeof(double));
  filter(dv6, dv7, b_y, a, y);
  flipud(y);
  for (i = 0; i < 7; i++) {
    dv6[i] = dv8[i];
    dv7[i] = dv9[i];
  }

  for (i = 0; i < 6; i++) {
    a[i] = b_a[i] * y[0];
  }

  memcpy(&c_y[0], &y[0], 1036U * sizeof(double));
  filter(dv6, dv7, c_y, a, y);
  flipud(y);
  memcpy(&Y[0], &y[18], 1000U * sizeof(double));
}

//
// Arguments    : const double x[2048]
// Return Type  : double
//
static double sum(const double x[2048])
{
  double y;
  int k;
  y = x[0];
  for (k = 0; k < 2047; k++) {
    y += x[k + 1];
  }

  return y;
}

//
// if size(signals,2) > size(signals,1)
//      signals = signals.';
//  end
// Arguments    : const double signals[3997]
//                double fs
//                const double window[2048]
//                double CSM[1024]
//                double frequencies[1024]
// Return Type  : void
//
static void welch_psd(const double signals[3997], double fs, const double
                      window[2048], double CSM[1024], double frequencies[1024])
{
  double data_taper[2048];
  int i;
  double S[1024];
  int a;
  double dv10[2048];
  double B;
  double Data_Block[2048];
  static creal_T b_Data_Block[2048];

  // % Function for spectra estimation by Welch's method
  //  Developed by Luiz A. Baccala, Fl?vio Caduda and Luciano Caldas, all from
  //  Escola Polit?cnica - Poli-USP, with cooperation of Carlos Pagani and Felipe 
  //  Amaral from Escola de Engenharia de S?o Carlos - EESC-USP.
  //
  //  Cross-spectra matrix are estimated by Welch's method with 50% overlap and
  //  the window energy loss are compasated by a factor of 1/sum(Wi.^2) where
  //  Wi are the elements of the window [1]. Then, the spectra becomes:
  //  Sxy = fft(x)*conj(fft(y))/sum(Wi.^2)
  //
  //  Code was tested with a known- spectra signal from a white noise filtered
  //  by a filter. The variance (power) of the signal checks with the integral
  //  of the PSD estimated.
  //
  //  INPUT:
  //  -- signals: matrix of signals to perform the spectra estimatino. Size is
  //  [Samples x number of sensors];
  //  -- fs: samplerate in Hertz;
  //  -- window: data taper desired. Must be a vector. For best performance it
  //  should be a power of 2. For general applications do: window=hanning(1024); 
  //
  //  OUTPUT:
  //  -- CSM: Cross Spectral Matrix: Unilateral (0:fs/2) spectra. Welch's
  //  method is used with 50% overlap. Matrix size: sensors x sensors x
  //  windowsize/2
  //  -- frequencies: vector with all frequencies corresponding to each layer
  //  (3rd layer in depth) of CSM.
  //
  //  LAST REVISION: Aug - 18 - 2016
  //  ADDED 'fs' missing term in line 82, for calibration factor
  //  [1] Trobs,M.; Heinzel,G. "Improved spectrum estimation from digitized
  //  time series on a logarithmic frequency axis"
  //  doi:10.1016/j.measurement.2005.10.010
  // must be even, best if 2^n
  // ORIGINAL;
  repmat(window, data_taper);

  //  Data segmentation into blocks of size block_samples:
  for (i = 0; i < 1024; i++) {
    frequencies[i] = (double)i * fs / 2048.0;
    S[i] = 0.0;
  }

  // ORIGINAL
  //  S = zeros(ceil(block_samples/2),number_of_signals.^2);
  for (a = 0; a < 2; a++) {
    //  Retrieve current data block
    i = a << 10;
    memcpy(&Data_Block[0], &signals[i], sizeof(double) << 11);
    B = mean(Data_Block);
    for (i = 0; i < 2048; i++) {
      Data_Block[i] = (Data_Block[i] - B) * data_taper[i];
    }

    // Taper it
    fft(Data_Block, b_Data_Block);

    // FFT it,
    //  bilateral DFT
    //  viii
    // ORIGINAL
    //  Data_Block = Data_Block(1:ceil(block_samples/2),:);
    // All spectral combinations:
    // ORIGINAL
    //  P = zeros(ceil(block_samples/2)/2,number_of_signals.^2);
    //  THIS IS FOR WIND TUNNEL EESC-USP BEAMFORMING CODE
    //              P(:,c) = real(Data_Block(:,b).*conj(Data_Block(:,aa)));
    //  P(:,c) = Data_Block(:,b).*conj(Data_Block(:,aa));
    //  IS FOR FAN RIG BEAMFORMING CODE
    //  P(:,c) = Data_Block(:,aa).*conj(Data_Block(:,b)); % THIS IS THE ORIGINAL LINE 
    //  Sum the spectrums up ...
    for (i = 0; i < 1024; i++) {
      S[i] += b_Data_Block[i].re * b_Data_Block[i].re - b_Data_Block[i].im *
        -b_Data_Block[i].im;
    }
  }

  power(window, dv10);
  B = sum(dv10) * fs * 2.0;

  //  Average them out
  //  for a = 1:sensors
  for (i = 0; i < 1024; i++) {
    CSM[i] = S[i] * 2.0 / B;
  }

  //  end
  //  clear S
  CSM[0] = (CSM[0] + CSM[0]) - CSM[0];
}

